import React, { Component } from 'react';


class App extends Component{

  constructor(props) {
    super(props)
    this.state = {
        saludo: []
     }
   }

  componentDidMount() {
    fetch("/saludo")
    .then(response => {
      return response.json();
    })
    .then((data) => {
          this.setState({saludo: data});
      })
  }


  render(){
    return(
      <div>
        <h1>{this.state.saludo.content}</h1>
        <h2>Segunda Capa </h2>
      </div>
    )
  }
}
export default App;
